    false,nt"url": null,nt"notes": "This annual narrative report for Swan River
    National Wildlife Refuge outlines Refuge accomplishments during the 1998 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. Refuge administration is outlined; information about
    personnel is given. Habitat management is also covered; subjects include wetlands,
    forests, grazing, haying, and pest control. The wildlife section of the report discusses
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, game mammals, and fisheries resources. The public uses of the Refuge described
    in this report include hunting, fishing, and law enforcement. The equipment and
    facilities section of the report provides information about construction, and equipment
    replacement.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
